Bio: The genre nude is my new hobby! I like to be photographed,but also love to photograph others. Mostly it is the nature and beautifully decorated food I photograph. I love delicious and beautifully presented food. I like to try different dishes from nations, each country has its own unique food tastes and customs. To me it's interesting because I'm a certified chef and I love to cook, not only at work in the restaurant but at home too. I love to please the gourmet and delicious food of my friends. In the future, I would like to open a restaurant in the city center. There will be the most delicious menu, beautiful interior and sexiest waitresses!
